import React, {Component} from "react";
import axios from 'axios';
import HeaderComponent from "./header.component";

export default class ItemViewComponent extends Component{

    constructor(props) {
        super(props);
        this.state = {
            data:[]
        };

    }

    componentDidMount() {
        this.loadData();
        document.getElementById('overview-wrapper').style.height = window.innerHeight;
    }

    async loadData(){
        axios.get('http://localhost:3000/items')
        .then(res =>{
            this.setState({
                data: res.data
            });
        });
    }


    tableData(){
        return this.state.data.map((object) => {
            return (
              <tr key={object.id}>
                  <td>{object.id}</td>
                  <td>{object.name}</td>
              </tr>
            );
        });
    }

    render() {
        return(
            <div>
                <HeaderComponent/>
            </div>
        );
    }
}
